import React,{useState, useEffect} from 'react'
import styled from 'styled-components'
import {Link, NavLink} from 'react-router-dom'
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import 'mobilenav.css'

function Mobile(){
const [slider, setslider]  = useState(false);
    return (
       <>
            <div className="navbar">
                <FaIcons.FaBars onClick={()=> setslider(!slider)}/>
                
                <div className="logo">FRONTVIEW</div>
            </div>
            <nav>
            <nav className={slider ? 'nav-menu active': 'nav-menu'}>

                    <ul className='navbar-menu-items'>
                           <li className='navbar-toggle'>
                            
                           <AiIcons.AiOutlineClose  onClick={()=> setslider(!slider)}/>

                           </li>
                           <li className='navbar-toggle' ><Link to='#' className='menu-bar'>HOME</Link></li> 
                           <li className='navbar-toggle'><Link to='#' className='menu-bar'>ABOUT</Link></li> 
                           <li className='navbar-toggle'><Link to='#' className='menu-bar'>CONTACT</Link></li> 
                    </ul>




            </nav>
            </nav>
       </>
    )
}







//......................................................................................
const Navbar = styled.div`
background-color: black;
color:white;
display:flex;
justify-content:space-between;
padding:1%;
width:100%;
`
const Way = styled.ul`
display:flex;
justify-content:space-around;
`

const Logo = styled.div`
color: white;
    font-family: ;
    min-width: 100%;
    text-align: center;
    font-family: cursive;
    font-size: 2rem;
`



function Nav(){





return(
<>

<div class="navbar">
            <div class="logo">
            FrontView
           </div>
            <div class="link">
                  <ul>
                  <li><NavLink to="/" >HOME</NavLink></li>
                  <li><NavLink to="/project">ABOUT</NavLink></li>
                  <li><NavLink to="/contact">CONTACT</NavLink></li>
                  </ul>
            </div>


  </div>

<Mobile/>


</>




)


}
export default Nav
